import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as h,c as e,d as n}from"./app.f259838b.js";const t={},o=n('<h2 id="\u4EC0\u4E48\u662Fpython" tabindex="-1"><a class="header-anchor" href="#\u4EC0\u4E48\u662Fpython" aria-hidden="true">#</a> \u4EC0\u4E48\u662Fpython</h2><p>Python\u662F\u4E16\u754C\u4E0A\u6700\u6D41\u884C\u7684\u89E3\u91CA\u578B\u7F16\u7A0B\u8BED\u8A00\u4E4B\u4E00\u3002Python \u7531 Guido van Rossum \u8BBE\u8BA1\uFF0C\u4F5C\u4E3A\u201CABC\u201D\u7F16\u7A0B\u8BED\u8A00\u7684\u7EE7\u627F\u8005\uFF0C\u4E8E 1991 \u5E74\u9996\u6B21\u53D1\u5E03\u3002\u5B83\u662F\u4E00\u79CD\u9AD8\u7EA7\u901A\u7528\u8BED\u8A00\uFF0C\u5176\u8BBE\u8BA1\u7406\u5FF5\u662F\u901A\u8FC7\u4F7F\u7528\u7F29\u8FDB\u6765\u5F3A\u8C03\u4EE3\u7801\u7684\u53EF\u8BFB\u6027\u3002Python \u7684\u8BED\u8A00\u7ED3\u6784\u65E8\u5728\u5E2E\u52A9\u7A0B\u5E8F\u5458\u4E3A\u5C0F\u578B\u548C\u5927\u578B\u9879\u76EE\u7F16\u5199\u903B\u8F91\u4EE3\u7801\u3002</p><p>\u8BE5\u8BED\u8A00\u662F\u52A8\u6001\u7C7B\u578B\u7684\uFF0C\u652F\u6301\u591A\u79CD\u7F16\u7A0B\u8303\u5F0F\u3002\u5B83\u5B8C\u5168\u652F\u6301\u9762\u5411\u5BF9\u8C61\u548C\u7ED3\u6784\u5316\u7F16\u7A0B\uFF0C\u5B83\u7684\u4E00\u4E9B\u7279\u6027\u652F\u6301\u51FD\u6570\u5F0F\u548C\u9762\u5411\u65B9\u9762\u7684\u7F16\u7A0B\u3002</p><p>Python \u88AB\u8BBE\u8BA1\u4E3A\u4E00\u79CD\u9AD8\u5EA6\u53EF\u6269\u5C55\u7684\u8BED\u8A00\u3002\u8FD9\u79CD\u6A21\u5757\u5316\u4F7F\u5F97\u5B83\u4F5C\u4E3A\u4E00\u79CD\u5411\u5DF2\u7ECF\u5B58\u5728\u7684\u5E94\u7528\u7A0B\u5E8F\u6DFB\u52A0\u63A5\u53E3\u7684\u65B9\u5F0F\u975E\u5E38\u6D41\u884C\u3002\u7531\u4E8E\u5176\u5168\u9762\u7684\u6807\u51C6\u5E93\uFF0C\u5B83\u901A\u5E38\u88AB\u63CF\u8FF0\u4E3A\u201C\u5305\u542B\u7535\u6C60\u201D\u7684\u8BED\u8A00\u3002\u6211\u4EEC\u9700\u8981\u611F\u8C22 ABC \u63D0\u4F9B\u7684\u8FD9\u4E2A\u7279\u6027\uFF0C\u56E0\u4E3A Python \u7684\u8BBE\u8BA1\u8005\u5BF9\u4E8E\u4E00\u4E2A\u62E5\u6709\u5927\u578B\u6807\u51C6\u5E93\u7684\u5C0F\u578B\u6838\u5FC3\u8BED\u8A00\u7684\u613F\u666F\u6E90\u4E8E\u4ED6\u5BF9 ABC \u8BED\u8A00\u7684\u632B\u8D25\u611F\uFF0C\u800C ABC \u8BED\u8A00\u662F\u57FA\u4E8E\u76F8\u53CD\u7684\u65B9\u6CD5\u3002</p><h2 id="\u8BED\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u8BED\u6CD5" aria-hidden="true">#</a> \u8BED\u6CD5</h2><p>Python \u7684\u683C\u5F0F\u5728\u89C6\u89C9\u4E0A\u5F88\u6574\u6D01\uFF0C\u5E76\u4E14\u7ECF\u5E38\u4F7F\u7528\u5173\u952E\u5B57\uFF1B\u7136\u800C\uFF0C\u8BB8\u591A\u5176\u4ED6\u8BED\u8A00\u4F9D\u8D56\u4E8E\u6807\u70B9\u7B26\u53F7\u3002Python \u7684\u53E6\u4E00\u4E2A\u663E\u7740\u533A\u522B\u662F\u5B83\u4E0D\u4F7F\u7528\u5927\u62EC\u53F7\u6765\u5206\u9694\u5757\u3002\u4E0E C \u7B49\u5176\u4ED6\u8BED\u8A00\u76F8\u6BD4\uFF0C\u5B83\u7684\u8BED\u6CD5\u5F02\u5E38\u548C\u7279\u6B8A\u60C5\u51B5\u8981\u5C11\u5F97\u591A\u3002</p><h2 id="\u7F29\u8FDB" tabindex="-1"><a class="header-anchor" href="#\u7F29\u8FDB" aria-hidden="true">#</a> \u7F29\u8FDB</h2><p>Python \u4F7F\u7528\u7A7A\u683C\u7F29\u8FDB\u6765\u5206\u9694\u5757\u3002\u5728\u67D0\u4E9B\u8BED\u53E5\u4E4B\u540E\u53EF\u80FD\u4F1A\u589E\u52A0\u7F29\u8FDB\uFF0C\u4F46\u7F29\u8FDB\u7684\u51CF\u5C11\u610F\u5473\u7740\u7A0B\u5E8F\u6BB5\u7684\u7ED3\u675F\u3002\u8FD9\u4F7F\u5F97\u7A0B\u5E8F\u7684\u89C6\u89C9\u7ED3\u6784\u51C6\u786E\u5730\u8868\u793A\u4E86\u7A0B\u5E8F\u7684\u8BED\u4E49\u7ED3\u6784\u3002</p><p>\u6B64\u529F\u80FD\u79F0\u4E3A\u201C\u8D8A\u4F4D\u89C4\u5219\u201D\u3002\u5B83\u53EF\u80FD\u4E0D\u662Fpython\u72EC\u6709\u7684\uFF0C\u800C\u662F\u5E26\u6709\u8BED\u4E49\u7684\uFF1B\u53E6\u4E00\u65B9\u9762\uFF0C\u5927\u591A\u6570\u8BED\u8A00\u7684\u7F29\u8FDB\u6CA1\u6709\u4EFB\u4F55\u8BED\u4E49\u610F\u4E49\u3002</p><h2 id="\u53D8\u91CF" tabindex="-1"><a class="header-anchor" href="#\u53D8\u91CF" aria-hidden="true">#</a> \u53D8\u91CF</h2><p>\u5728 Python \u4E2D\uFF0C\u53D8\u91CF\u540D\u662F\u4E00\u4E2A\u5F15\u7528\u6301\u6709\u8005\uFF0C\u6CA1\u6709\u4E0E\u4E4B\u5173\u8054\u7684\u56FA\u5B9A\u6570\u636E\u7C7B\u578B\u3002\u5B83\u4EEC\u53EF\u4EE5\u968F\u65F6\u53CD\u5F39\u5230\u4EFB\u4F55\u7269\u4F53\u4E0A\u3002\u5C3D\u7BA1\u5728\u7ED9\u5B9A\u65F6\u95F4\uFF0C\u53D8\u91CF\u5C06\u5F15\u7528\u67D0\u4E2A\u5BF9\u8C61\uFF0C\u8BE5\u5BF9\u8C61\u672C\u8EAB\u5177\u6709\u7C7B\u578B\u3002\u8FD9\u79F0\u4E3A\u52A8\u6001\u7C7B\u578B\u3002</p><p>\u8FD9\u4E0E Java\u3001C++\u3001FORTRAN\u3001Scala \u548C Pascal \u7B49\u8BED\u8A00\u5B8C\u5168\u76F8\u53CD\uFF0C\u56E0\u4E3A\u5B83\u4EEC\u662F\u9759\u6001\u7C7B\u578B\u7684\u7F16\u7A0B\u8BED\u8A00\uFF0C\u5176\u4E2D\u6BCF\u4E2A\u53D8\u91CF\u53EA\u80FD\u5305\u542B\u7279\u5B9A\u7C7B\u578B\u7684\u503C\u3002</p><h2 id="\u8868\u8FBE\u5F0F" tabindex="-1"><a class="header-anchor" href="#\u8868\u8FBE\u5F0F" aria-hidden="true">#</a> \u8868\u8FBE\u5F0F</h2><p>\u8868\u8FBE\u5F0F\u662F\u7F16\u7A0B\u8BED\u8A00\u4E2D\u7684\u8BED\u6CD5\u5B9E\u4F53\uFF0C\u53EF\u4EE5\u5BF9\u5176\u8FDB\u884C\u8BC4\u4F30\u4EE5\u786E\u5B9A\u5176\u503C\u3002\u5B83\u662F\u7F16\u7A0B\u8BED\u8A00\u89E3\u91CA\u548C\u8BA1\u7B97\u4EE5\u4EA7\u751F\u503C\u7684\u5E38\u91CF\u3001\u53D8\u91CF\u3001\u51FD\u6570\u548C\u8FD0\u7B97\u7B26\u7684\u7EC4\u5408\u3002 \u5728 Python \u4E2D\uFF0C\u8868\u8FBE\u5F0F\u548C\u8BED\u53E5\u662F\u6709\u533A\u522B\u7684\u3002\u4E5F\u5C31\u662F\u8BF4\uFF0C\u8BED\u53E5\u4E0D\u80FD\u662F\u8868\u8FBE\u5F0F\u7684\u7EC4\u6210\u90E8\u5206\u3002\u8FD9\u4E2A\u7279\u6027\u5E76\u4E0D\u5E38\u89C1\uFF0C\u56E0\u4E3A\u5B83\u5728\u4E00\u4E9B\u4E3B\u8981\u8BED\u8A00\u4E2D\u6CA1\u6709\uFF0C\u6BD4\u5982 Scheme\u3001Common Lisp \u6216 Ruby\u3002\u4F46\u662F\u8FD9\u4F1A\u5BFC\u81F4\u91CD\u590D\u67D0\u4E9B\u529F\u80FD\u3002</p><h2 id="\u7C7B\u578B" tabindex="-1"><a class="header-anchor" href="#\u7C7B\u578B" aria-hidden="true">#</a> \u7C7B\u578B</h2><p>Python \u4F7F\u7528\u9E2D\u5B50\u7C7B\u578B\uFF0C\u8FD9\u662F\u4E00\u79CD\u7528\u4E8E\u786E\u5B9A\u5BF9\u8C61\u662F\u5426\u53EF\u4EE5\u7528\u4E8E\u7279\u5B9A\u76EE\u7684\u7684\u5E94\u7528\u7A0B\u5E8F\u3002\u5728\u8FD9\u79CD\u8BED\u8A00\u4E2D\uFF0C\u7F16\u8BD1\u65F6\u4E0D\u68C0\u67E5\u7C7B\u578B\u7EA6\u675F\u3002\u5BF9\u5BF9\u8C61\u6267\u884C\u64CD\u4F5C\u5931\u8D25\u610F\u5473\u7740\u7ED9\u5B9A\u7684\u5BF9\u8C61\u4E0D\u662F\u5408\u9002\u7684\u7C7B\u578B\u3002 Python \u662F\u4E00\u79CD\u5F3A\u7C7B\u578B\u8BED\u8A00\uFF0C\u56E0\u6B64\u5B83\u4E0D\u5141\u8BB8\u5B9A\u4E49\u4E0D\u660E\u786E\u7684\u64CD\u4F5C\uFF0C\u800C\u4E0D\u662F\u9ED8\u9ED8\u5730\u5C1D\u8BD5\u7406\u89E3\u5B83\u4EEC\u3002</p><p>\u5B83\u5141\u8BB8\u7A0B\u5E8F\u5458\u4F7F\u7528\u7C7B\u5B9A\u4E49\u81EA\u5DF1\u7684\u7C7B\u578B\u3002\u53EF\u4EE5\u901A\u8FC7\u8C03\u7528\u7C7B\u6765\u6784\u9020\u7C7B\u7684\u65B0\u5B9E\u4F8B\u3002</p><h2 id="\u65B9\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u65B9\u6CD5" aria-hidden="true">#</a> \u65B9\u6CD5</h2><p>\u8FD9\u91CC\u7684\u201C\u65B9\u6CD5\u201D\u662F\u4E0E\u6D88\u606F\u548C\u5BF9\u8C61\u76F8\u5173\u8054\u7684\u8FC7\u7A0B\u3002\u4E00\u4E2A\u5BF9\u8C61\u7531\u6570\u636E\u548C\u884C\u4E3A\u7EC4\u6210\uFF1B\u8FD9\u4E9B\u5305\u62EC\u4E00\u4E2A\u63A5\u53E3\uFF0C\u8BE5\u63A5\u53E3\u6307\u5B9A\u5BF9\u8C61\u5982\u4F55\u88AB\u5176\u4EFB\u4F55\u6D88\u8D39\u8005\u4F7F\u7528\u3002</p><p>Python \u65B9\u6CD5\u6709\u4E00\u4E2A\u663E\u5F0F\u7684 self \u53C2\u6570\u6765\u8BBF\u95EE\u5B9E\u4F8B\u6570\u636E\u3002Python \u8FD8\u63D0\u4F9B\u4E86\u65B9\u6CD5\uFF0C\u901A\u5E38\u79F0\u4E3A dunder \u65B9\u6CD5\uFF0C\u5141\u8BB8\u7528\u6237\u5B9A\u4E49\u7684\u7C7B\u4FEE\u6539\u5B83\u4EEC\u5982\u4F55\u88AB\u672C\u5730\u64CD\u4F5C\u5904\u7406\uFF0C\u4F8B\u5982\u957F\u5EA6\u3001\u6BD4\u8F83\u3001\u7B97\u672F\u8FD0\u7B97\u3001\u7C7B\u578B\u8F6C\u6362\u7B49\u3002</p><h2 id="\u5E93" tabindex="-1"><a class="header-anchor" href="#\u5E93" aria-hidden="true">#</a> \u5E93</h2><p>Python \u6709\u4E00\u4E2A\u5F88\u5927\u7684\u6807\u51C6\u5E93\u3002\u5B83\u80FD\u591F\u63D0\u4F9B\u9002\u7528\u4E8E\u8BB8\u591A\u4EFB\u52A1\u7684\u5DE5\u5177\u3002\u5B83\u5305\u62EC\u7528\u4E8E\u521B\u5EFA\u56FE\u5F62\u7528\u6237\u754C\u9762 (GUI)\u3001\u8FDE\u63A5\u5230\u5173\u7CFB\u6570\u636E\u5E93\u3001\u751F\u6210\u4F2A\u968F\u673A\u6570\u3001\u64CD\u4F5C\u6B63\u5219\u8868\u8FBE\u5F0F\u3001\u5355\u5143\u6D4B\u8BD5\u7B49\u7684\u6A21\u5757\u3002</p><p>\u5927\u591A\u6570\u6807\u51C6\u5E93\u662F\u8DE8\u5E73\u53F0\u7684 Python \u4EE3\u7801\uFF0C\u56E0\u6B64\u53EA\u6709\u5C11\u6570\u6A21\u5757\u9700\u8981\u66F4\u6539\u6216\u91CD\u5199\u4EE5\u8FDB\u884C\u53D8\u4F53\u5B9E\u73B0\u3002</p><h2 id="python\u7684\u5E94\u7528" tabindex="-1"><a class="header-anchor" href="#python\u7684\u5E94\u7528" aria-hidden="true">#</a> Python\u7684\u5E94\u7528</h2><p>Python \u53EF\u4EE5\u4F5C\u4E3A Web \u5E94\u7528\u7A0B\u5E8F\u7684\u811A\u672C\u8BED\u8A00\u3002\u6709\u4E86 Web \u670D\u52A1\u5668\u7F51\u5173\u63A5\u53E3\uFF0C\u6807\u51C6 API \u5DF2\u7ECF\u53D1\u5C55\u5230\u53EF\u4EE5\u4FC3\u8FDB\u8FD9\u4E9B\u5E94\u7528\u7A0B\u5E8F\u3002</p><p>NumPy\u3001SciPy \u548C Matplotlib \u7B49\u5E93\u5141\u8BB8\u5728\u79D1\u5B66\u8BA1\u7B97\u4E2D\u6709\u6548\u5730\u4F7F\u7528 Python\u3002Biopython \u548C Astropy \u7B49\u5E93\u63D0\u4F9B\u7279\u5B9A\u9886\u57DF\u7684\u529F\u80FD\u3002SageMath \u662F\u4E00\u4E2A\u8BA1\u7B97\u673A\u4EE3\u6570\u7CFB\u7EDF\uFF0C\u5E26\u6709\u53EF\u5728 Python \u4E2D\u7F16\u7A0B\u7684\u7B14\u8BB0\u672C\u754C\u9762\u3002\u5B83\u7684\u5E93\u53EF\u4EE5\u6DB5\u76D6\u6570\u5B66\u7684\u5404\u4E2A\u65B9\u9762\uFF0C\u4F8B\u5982\u4EE3\u6570\u3001\u7EC4\u5408\u3001\u6570\u503C\u6570\u5B66\u3001\u6570\u8BBA\u548C\u5FAE\u79EF\u5206\u3002</p><p>\u5728 TensorFlow\u3001Keras\u3001Pytorch \u548C Scikit-learn \u7B49\u5E93\u7684\u5E2E\u52A9\u4E0B\uFF0CPython \u5E38\u7528\u4E8E\u4EBA\u5DE5\u667A\u80FD\u9879\u76EE\u548C\u673A\u5668\u5B66\u4E60\u9879\u76EE\u3002Python \u56E0\u5176\u6A21\u5757\u5316\u67B6\u6784\u3001\u7B80\u5355\u7684\u8BED\u6CD5\u548C\u5BCC\u6587\u672C\u5904\u7406\u5DE5\u5177\u800C\u5E38\u7528\u4E8E\u81EA\u7136\u8BED\u8A00\u5904\u7406\u3002</p><p>Python \u4E5F\u53EF\u4EE5\u7528\u6765\u521B\u5EFA\u6E38\u620F\uFF0C\u4F7F\u7528 Pygame \u7B49\u5E93\u53EF\u4EE5\u5236\u4F5C 2D \u6E38\u620F\u3002</p><p>GNU Debugger \u4F7F\u7528 Python \u4F5C\u4E3A\u6F02\u4EAE\u7684\u6253\u5370\u673A\u6765\u663E\u793A\u590D\u6742\u7684\u7ED3\u6784\uFF0C\u4F8B\u5982 C++ \u5BB9\u5668\u3002Esri \u5C06 Python \u63A8\u5E7F\u4E3A\u5728 ArcGIS \u4E2D\u7F16\u5199\u811A\u672C\u7684\u6700\u4F73\u9009\u62E9\u3002\u5B83\u5DF2\u88AB\u7528\u4F5C Google App Engine \u4E2D\u4E09\u79CD\u53EF\u7528\u7F16\u7A0B\u8BED\u8A00\u4E2D\u7684\u7B2C\u4E00\u79CD\u3002</p><p>\u8BB8\u591A\u64CD\u4F5C\u7CFB\u7EDF\u90FD\u5C06 Python \u4F5C\u4E3A\u6807\u51C6\u7EC4\u4EF6\u3002\u5B83\u968F\u5927\u591A\u6570 Linux \u53D1\u884C\u7248\u4E00\u8D77\u63D0\u4F9B\uFF0C\u5E76\u4E14\u53EF\u4EE5\u4ECE\u547D\u4EE4\u884C\u7EC8\u7AEF\u4F7F\u7528\u3002\u8BB8\u591A Linux \u53D1\u884C\u7248\u4F7F\u7528\u7528 Python \u7F16\u5199\u7684\u5B89\u88C5\u7A0B\u5E8F\u3002\u4F8B\u5982\uFF0CUbuntu \u4F7F\u7528 Ubiquity \u5B89\u88C5\u7A0B\u5E8F\uFF0C\u800C Red Hat Linux \u548C Fedora \u4F7F\u7528 Anaconda \u5B89\u88C5\u7A0B\u5E8F\u3002</p><p>Python \u8FD8\u5E7F\u6CDB\u7528\u4E8E\u4FE1\u606F\u5B89\u5168\u884C\u4E1A\uFF0C\u5305\u62EC\u6F0F\u6D1E\u5229\u7528\u5F00\u53D1\u3002</p><h2 id="\u503C\u5F97\u5B66\u4E60python\u5417" tabindex="-1"><a class="header-anchor" href="#\u503C\u5F97\u5B66\u4E60python\u5417" aria-hidden="true">#</a> \u503C\u5F97\u5B66\u4E60Python\u5417\uFF1F</h2><p>\u81EA 2003 \u5E74\u4EE5\u6765\uFF0CPython \u4E00\u76F4\u4F4D\u5C45\u6700\u6D41\u884C\u7684\u5341\u5927\u7F16\u7A0B\u8BED\u8A00\u4E4B\u5217\u3002\u5B83\u5728 2007 \u5E74\u30012010 \u5E74\u30012018 \u5E74\u548C 2020 \u5E74\u88AB\u8BC4\u4E3A\u5E74\u5EA6\u7F16\u7A0B\u8BED\u8A00\uFF0C\u662F\u552F\u4E00\u56DB\u6B21\u83B7\u5F97\u8BE5\u5956\u9879\u7684\u8BED\u8A00\u3002 \u4EC5\u5728\u8FC7\u53BB\u4E09\u5E74\u4E2D\uFF0CPython \u7684\u4EF7\u503C\u5C31\u51FA\u73B0\u4E86\u663E\u7740\u589E\u957F\u3002\u5728\u53EF\u9884\u89C1\u7684\u672A\u6765\uFF0C\u5B83\u5E76\u6CA1\u6709\u5931\u53BB\u5B83\u7684\u4EF7\u503C\u3002\u56E0\u6B64\uFF0C\u5B66\u4E60 Python \u7EDD\u5BF9\u503C\u5F97\u4F60\u82B1\u8D39\u65F6\u95F4\u548C\u7CBE\u529B\u3002</p>',33),r=[o];function d(i,p){return h(),e("div",null,r)}var s=a(t,[["render",d],["__file","index.html.vue"]]);export{s as default};
